/* eslint-disable func-style */
/* eslint-disable max-len */
/* eslint-disable require-jsdoc */
function addBlocks (Blockly) {
    const color = '#42CCFF';
    const keypadIconUrl = 'data:image/png;base64,';
    
    const digitalPins = Blockly.getMainWorkspace().getFlyout()
        .getFlyoutItems()
        .find(block => block.type === 'arduino_pin_setDigitalOutput')
        .getField('PIN')
        .getOptions();

    Blockly.Blocks.keypad_init = {
        init: function () {
            this.jsonInit({
                message0: '%1',
                message1: Blockly.Msg.KEYPAD_INIT,
                args0: [
                    {
                        type: 'field_image',
                        src: keypadIconUrl,
                        width: 50,
                        height: 27
                    }
                ],
                colour: color,
                extensions: ['shape_statement']
            });
        }
    };

    Blockly.Blocks.keypad_read = {
        init: function () {
            this.jsonInit({
                message0: '%1',
                message1: Blockly.Msg.KEYPAD_READ,
                args0: [
                    {
                        type: 'field_image',
                        src: keypadIconUrl,
                        width: 50,
                        height: 27
                    }
                ],
                colour: color,
                extensions: ['output_number']
            });
        }
    };

    return Blockly;
}

exports = addBlocks;
